 * 加一个头指针,操作会更方便
 * 当 p.next 和 p.next.next 非空时,交换；p后移2位
 * 这道题考察的是改变指针指向，实现链表节点位置交换
 */
public class Solution {
    public ListNode swapPairs(ListNode head) {
        ListNode h = new ListNode(-1);
        ListNode p = h, q;
        h.next = head;

        while (p.next != null && p.next.next!= null) {
            q = p.next;
            p.next = q.next;
            q.next = p.next.next;
            p.next.next = q;
            p = p.next.next;
        }
        return h.next;
    }
}

