        Arrays.sort(nums);
        permuteRecursion(result, nums, tmp, flag);
        return result;
    }

    public void permuteRecursion(List> result, int[] nums, ArrayList tmp, boolean[] flag) {
        int len = nums.length;

        if (tmp.size() == len) {
            result.add((List) tmp.clone());
            return;
        }

        for (int i = 0; i  0 && nums[i] == nums[i -1 ] && !flag[i - 1]) continue;

            flag[i] = true;
            tmp.add(nums[i]);
            permuteRecursion(result, nums, tmp, flag);
