            int key = 1;
            for (char ch: s.toCharArray()) {
                key *= prime[ch - 'a'];
            }

            if (hash.containsKey(key)) {
                result.get(hash.get(key)).add(s);
            } else {
                List t = new ArrayList<>();
                t.add(s);
                result.add(t);
                hash.put(key, result.size() - 1);
            }
        }

        for (List list: result) {
            Collections.sort(list);
        }
        return result;
    }
