public class Solution {
    public List> pathSum(TreeNode root, int sum) {
        List> result = new ArrayList<>();
        ArrayList tmp = new ArrayList<>();
        if (root != null) helper(result, tmp, root, sum);
        return result;
    }

    private void helper(List> result, ArrayList item, TreeNode root, int sum) {
        item.add(root.val);

        if (root.left == null && root.right == null) {
            if (sum == root.val) result.add((List) item.clone());
            return;
        }

        if (root.left != null) {
            helper(result, item, root.left, sum - root.val);
            item.remove(item.size() - 1);
        }

        if (root.right != null) {
            helper(result, item, root.right, sum - root.val);
            item.remove(item.size() - 1);
        }
    }
